    useEffect(() => {
        const isAuthenticated = true; // Здесь должна быть логика проверки аутентификации
    
        if (isAuthenticated) {
          console.log('Authenticated');
        }
      }, []);
    return (
        <>
            <Header />
            <Sidebar />
            <StarsBackground />
            <Posts />
        </>
    );
};

export default Main;
